window.bookSummaryJSON = "<p>For a book-obsessed kid with a big imagination and a flair for drama, could anything be luckier than living in a library? Capturing her remarkable childhood and its impact, Sharon Washington's autobiographical Off-Broadway show brings its sense of wonder and bittersweet realism into your home and heart as an enthralling audio experience. Only from Audible, <i>Feeding the Dragon</i> celebrates the role of books in opening Washington's mind to worlds of possibilities - including a career in acting.</p> <p>As part of our mission to offer listeners outstanding performances in contemporary theater, we are thrilled to present acclaimed stage actor Washington’s debut as a playwright. Intimate and emotionally nuanced, Sharon Washington's reckoning of childhood, race, and memory is, as one listener says, a \"feast for the creative soul.\"&nbsp;</p>"; 
